import { GlobalStyle } from "./GlobalStyle";
import Jogo from "./Jogo/Jogo";

export default function App() {
  const [countmiss, setCountMiss] = useState(0);
  return (
    <>
      <GlobalStyle />
      <Jogo countmiss={countmiss} setCountMiss={setCountMiss} />
    </>
  );
}
